import { faAngellist } from "@fortawesome/free-brands-svg-icons/faAngellist";
import { faFacebookF } from "@fortawesome/free-brands-svg-icons/faFacebookF";
import { faGithub } from "@fortawesome/free-brands-svg-icons/faGithub";
import { faLinkedinIn } from "@fortawesome/free-brands-svg-icons/faLinkedinIn";
// See https://fontawesome.com/icons?d=gallery&s=brands,regular&m=free
// to add other icons.

const data = [
  {
    link: "https://github.com/kaustubh1955",
    label: "Github",
    icon: faGithub,
  },
  {
    link: "https://www.facebook.com/kaustubh.dwivevdi.3",
    label: "Facebook",
    icon: faFacebookF,
  },
  {
    link: "https://www.linkedin.com/in/kaustubh-dwivedi-29760919a/",
    label: "LinkedIn",
    icon: faLinkedinIn,
  },
  {
    link: "https://angel.co/u/kaustubh-dwivedi",
    label: "Angel List",
    icon: faAngellist,
  },
];

export default data;
